import React from "react";
import {
  Container,
  Text,
  CaptionText,
  CommandButton,
  PrimaryButton,
  SearchInput,
  OutlinedButton,
  ActionButton,
  IconButton,
  Header,
  SubHeader,
  SubText,
} from "../../styledComponents";
import styled from "styled-components";
import MoreIcon from "@material-ui/icons/MoreHoriz";

const Wrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  flex: 0.8;
  width: 100%;
  padding-top: 0px;
  padding-left: 110px;
  padding-bottom: 0px 110px;
  padding-right: 0px 110px;
`;
const SideContainer = styled(Container)`
  display: flex;
  flex-direction: column;
  width: 100%;
  flex: 0.2;
  background-color: white;
`;
const Card = styled(Container)`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  height: 90px;
  min-width: 220px;
  background-color: white;
  border-radius: 3px;
  padding: 15px;
  margin-right: 20px;
  margin-right: 20px;
`;
const ActionBtn = styled(ActionButton)`
  display: flex;
  justify-content: center;
  align-items: center;
  align-content: center;
  padding-right: 10px;
  padding-left: 10px;
  border-radius: 2px;
  background-color: ${({ theme }) => theme.lightGrey};
`;
const Dashboard = () => {
  return (
    <Container flex={1} row>
      <Wrapper>
        <Container row customStyles={{ paddingTop: 40, paddingBottom: 20 }}>
          <SubHeader customStyles={{ marginRight: 10 }}>
            Welcome back,
          </SubHeader>

          <SubHeader customStyles={{ color: "#009688" }}>Rene La</SubHeader>
        </Container>
        <Container
          customStyles={{ paddingTop: 20, paddingBottom: 20 }}
          wrap
          row
        >
          <Card>
            <Container row space="space-between" center color="transparent">
              <CaptionText>Number of houses</CaptionText>
              <IconButton>
                <MoreIcon style={{ fontSize: 25 }} />
              </IconButton>
            </Container>
            <Container color="transparent">
              <SubHeader customStyles={{ color: "#0078D4" }}>23</SubHeader>
            </Container>
          </Card>
          <Card>
            <Container row space="space-between" center color="transparent">
              <CaptionText>Number of Tenants</CaptionText>
              <IconButton>
                <MoreIcon style={{ fontSize: 25 }} />
              </IconButton>
            </Container>
            <Container color="transparent">
              <SubHeader customStyles={{ color: "#009688" }}>10</SubHeader>
            </Container>
          </Card>
          <Card>
            <Container row space="space-between" center color="transparent">
              <CaptionText>Number of Tickets</CaptionText>
              <IconButton>
                <MoreIcon style={{ fontSize: 25, color: "#979a9a" }} />
              </IconButton>
            </Container>
            <Container color="transparent">
              <SubHeader customStyles={{ color: "#ED6161" }}>100</SubHeader>
            </Container>
          </Card>
        </Container>
      </Wrapper>
      <SideContainer />
    </Container>
  );
};

export default Dashboard;
